g2:c.PROCEDURE.g2:a.TEXT:
set-up-script-commands()

    installation-dir, dir-sep, file-path, src-folder, working-directory, soft-version, cmd-name, suffix: text;
    version-struct: structure;
    
begin
    soft-version = call g2-get-software-version ();
    if position-of-text("Linux", soft-version) /= 0 then begin
        conclude that os-type = the symbol linux;
        cmd-name = "bash";
        suffix = "sh";
    end else begin
        conclude that os-type = the symbol windows;
        suffix = "bat";
        cmd-name = "";
    end;

    version-struct = call g2-get-g2-version-information();
    installation-dir = call grtl-get-installation-directory();
    dir-sep = call grtl-get-file-system-delimiter();
    src-folder = "[installation-dir][dir-sep]..[dir-sep]..[dir-sep]..[dir-sep]";
    working-directory = call g2-default-directory();

    if the enterprise of version-struct then begin
        conclude that start-javalink-command = "[cmd-name] [src-folder]tests[dir-sep]test-javalink[dir-sep]start-jgidemo.[suffix] ENT";
    end else begin
        conclude that start-javalink-command = "[cmd-name] [src-folder]tests[dir-sep]test-javalink[dir-sep]start-jgidemo.[suffix] STD";
    end;
    conclude that stop-javalink-command = "[cmd-name] [src-folder]tests[dir-sep]test-javalink[dir-sep]start-jgidemo.[suffix] STOP";
    conclude that check-memory-usage-command = "[cmd-name] [src-folder]tests[dir-sep]test-javalink[dir-sep]start-jgidemo.[suffix] ECHO-MEMORY";
    conclude that memory-data-file = "[working-directory][dir-sep]mem_file"; 
    conclude that stop-cmd-flag-file = "[working-directory][dir-sep]stopped";
end

memory-leak-test(node: class benchmark-node)

    err: class error;
    i: integer;
    succ: truth-value;
    s-mem, e-mem, d-mem: float;

begin
    // start jgidemo's ExampleG2Gateway bridge
    call start-javalink();
    wait for 30 seconds;
    
    // verify local java interface is connected
    change the text of the gsi-connection-configuration of java-interface to "tcp-ip host @"localhost@" port-number 22044";
    wait for 2 seconds;
    if the gsi-interface-status of java-interface /= 2 then begin
        call stop-javalink();
        call fail(node, "javalink ExampleG2Gateway bridge is not started");
        return;
    end;
    
    // close console output
    start JAVA-SET-OUTPUT(false) across java-interface;
    wait for 2 seconds;

    // get memory usage before test
    succ, s-mem = call stat-memory-usage(memory-data-file, 30);
    if not(succ) then begin
        call stop-javalink();
        call fail(node, "failed to stat memory usage before test");
        return;
    end;

    conclude that the array-length of test-integer-array = 10000;
    for i = 0 to 2000 do
        call call_send_receive(test-integer-array, the symbol none);
    end;

    // get memory usage after test
    succ, e-mem = call stat-memory-usage(memory-data-file, 30);
    if not(succ) then begin
        call stop-javalink();
        call fail(node, "failed to stat memory usage after test");
        return;
    end; 

    d-mem = (e-mem - s-mem) / 1024.0 / 1024.0;
    post "[d-mem]";
    if d-mem > 50 then begin
        call stop-javalink();
        call fail(node, "memory leak still happens, cost [d-mem]M memory");
        return;
    end;

    call stop-javalink();
    call pass(node);

end on error(err)
    call stop-javalink();
    call fail(node, "[the error-description of err]");
end

stop-javalink()

    sec: integer;
    exist: truth-value;

begin
    call g2-spawn-process-to-run-command-line(stop-javalink-command);
    sec = 0;
    repeat 
        exist = call g2-file-exists(stop-cmd-flag-file);
        exit if exist;
        sec = sec + 1; 
        exit if sec > 30; 
        wait for 1 second;
    end;
end

stat-memory-usage(file-path: text, time-out: integer) = (truth-value, float)

    stream: class g2-stream;
    file-exist: truth-value;
    sec, i, b: integer;
    bytes: sequence;
    n-bytes: float;
    
begin
    call check-memory-usage();
    sec = 0;
    repeat
        file-exist = call g2-file-exists(file-path);
        exit if file-exist;
        sec = sec + 1;
        exit if sec > time-out;
        wait for 1 second;
    end;
    if not(file-exist) then return false, 0;
    stream = call g2-open-file-for-read(file-path);
    bytes = call g2-read-bytes-as-sequence(stream, 30);
    call g2-close-file(stream);
    wait for 2 seconds;
    call g2-delete-file(file-path);
    n-bytes = 0.0;
    for i = 0 to the number of elements in bytes - 1 do
        b = bytes[i];
        if b >= 48 and b <= 57 then begin
            n-bytes = n-bytes * 10.0 + (b - 48);
        end;
    end;
    return true, n-bytes;
end
